import React from "react";
import Player from "./Player";
import classes from "./PlayersFeed.module.css"
const PlayersFeed = () => {
    const [players, setPlayers] = React.useState([]);
    React.useEffect(() => {
        fetch('https://643964301b9a7dd5c9666ed2.mockapi.io/matches')
            .then((res) => {
                return res.json();
            })
            .then((arr) => {
                setPlayers(arr)
            })
    },[]);
    return (
        <div>
            <h1 className={classes.title}>Новости</h1>
            <div className={classes.allPlayers}>
                {players.map((item, index) => (
                    <Player key={index} players={item}/>
                ))}
            </div>
        </div>
    );
};

export default PlayersFeed;
